import Room from "../components/Room";
import GlobalStyle from "../components/styles/GlobalStyles";
import { connect } from "react-redux";

const Index = () => {
  return (
    <div>
      <h1>Rooms</h1>
      <GlobalStyle />

      <Room />

      <button>Submit</button>
    </div>
  );
};

export default connect(state => state)(Index);
